// src/components/UserCrud.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

function UserCrud() {
  const navigate = useNavigate();
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-blue-100 p-4">
      <h1 className="text-4xl font-bold text-blue-800 mb-4">Gestión de Usuarios (CRUD)</h1>
      <p className="text-lg text-gray-700 mb-6">Aquí podrás crear, leer, actualizar y eliminar usuarios.</p>
      <button
        onClick={() => navigate('/')}
        className="px-6 py-3 bg-indigo-500 text-white rounded-lg shadow-md hover:bg-indigo-600 transition duration-300"
      >
        Volver a la Página Principal
      </button>
    </div>
  );
}

export default UserCrud;
